import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  const expenses = props.expenses;

  return (
    <div className="expenses">
      <ExpenseItem
        date={expenses.date}
        title={expenses.title}
        amount={expenses.amount}
      />
      <ExpenseItem
        date={expenses.date}
        title={expenses.title}
        amount={expenses.amount}
      />
      <ExpenseItem
        date={expenses.date}
        title={expenses.title}
        amount={expenses.amount}
      />
      <ExpenseItem
        date={expenses.date}
        title={expenses.title}
        amount={expenses.amount}
      />
    </div>
  );
}

export default Expenses;
